def sum_strings(x, y):  # сложение двух строк без инт
    len_x, len_y = len(x), len(y)
    if len_x == 0 and len_y == 0:
        return '0'
    elif len_x == 0:
        return ''.join(y)
    elif len_y == 0:
        return ''.join(x)

    x, y = list(x), list(y)
    temporal = []
    temporal2 = 0

    for i in range(min(len_x, len_y)):
        temporal3 = temporal2 + int(x[-i - 1]) + int(y[-i - 1])
        x[-i - 1], y[-i - 1] = -1, -1
        if temporal3 >= 10:
            temporal2 = 1
            temporal3 -= 10
        else:
            temporal2 = 0
        temporal.append(temporal3)

    while -1 in x:
        x.remove(-1)
    while -1 in y:
        y.remove(-1)
    if len(x) != 0:
        temporal4 = x
    else:
        temporal4 = y
    temporal5 = 0
    if temporal2 == 0 and len(temporal4) != 0:
        for i in range(len(temporal4)):
            temporal.append(temporal4[-i - 1])
    while temporal2 != 0 and temporal5 != len(temporal4):
        temporal5 += 1
        temporal3 = temporal2 + int(temporal4[-temporal5])
        if temporal3 >= 10:
            temporal3 -= 10
            temporal2 = 1
            temporal.append(temporal3)
        else:
            temporal.append(temporal3)
            temporal2 = 0
            temporal4 = temporal4[:-temporal5]
            for i in range(len(temporal4)):
                temporal.append(temporal4[-i - 1])
    if temporal2 == 1:
        temporal.append(1)
    if len(temporal) == 0:
        return '0'
    while temporal[-1] == 0:
        temporal = temporal[:-1]
        if len(temporal) == 0:
            return '0'
    return ''.join(temporal[::-1])


print(sum_strings('', ''))